import React from 'react';
import { View, Image, Text, StyleSheet, ScrollView } from 'react-native';
import { AntDesign } from '@expo/vector-icons';

const Home = () => {
  return (
    <ScrollView contentContainerStyle={styles.container}>
      <View style={styles.content}>
        <Image
          source={require('../assets/westwood-logo.png')}
          style={styles.logo}
          resizeMode="contain"
        />
        <Text style={styles.text}>Westwood High School</Text>
      </View>
      <AntDesign name="arrowdown" size={24} color="black" style={styles.arrow} />
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    flexGrow: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#fff',
  },
  content: {
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'center',
    marginBottom: 50,
  },
  logo: {
    width: 150,
    height: 150,
    marginRight: 20,
  },
  text: {
    fontSize: 24,
    fontWeight: 'bold',
    textAlign: 'center',
  },
  arrow: {
    position: 'absolute',
    bottom: 20,
  },
});

export default Home;
